import React from 'react';

const PageSecond =() =>{
    return(
        <>
            <h1 className="heading">Welcome to Table</h1>
            <div className="mt-3">
            <button className="btn">
                        Go to Pie Chart
                        </button>
                    </div>
        </>
    )
};

export default PageSecond;
